import 'package:shiftapp/presentation/adminFeatures/admin_wallet/domain/entities/pending_payed_admin_wallet.dart';import '../../data/models/admin_wallet_dto.dart';import 'deposit_admin_wallet.dart';class AdminWallet {  AdminWallet({    this.design,    this.deposit,    this.pendingPayed,  });  int? design;  List<DepositAdminWallet>? deposit;  List<PendingPayedAdminWallet>? pendingPayed;  factory AdminWallet.fromDto(AdminWalletDto json) {    return AdminWallet(      design: json.design,      deposit: json.deposit?.map((e) => DepositAdminWallet.fromDto(e)).toList(),      pendingPayed: json.pendingPayed?.map((e) => PendingPayedAdminWallet.fromDto(e)).toList(),    );  }}